import React from 'react';
import { Link } from "react-router-dom";



function gotoSearch(){
  return <Redirect to= {"/search"}/>;
  alert("Hello");
}

function App() {
  return (
    <header>
      <div class="logo">

          <img src="logo.png" onclick="gotoSearch();" width="60" height="60px" />

      </div>
      <div class="menu">
        <ul>
          <li><a class="text" href="/search" onclick="gotoSearch();">Поиск</a></li>
          <li><a class="text" href="/register">Регистрация</a></li>
          <li><a class="text" href="/cabinet">Личный кабинет</a></li>
          <li><a class="text" href="/add">Добавить</a></li>
          <li><a class="text" href="/feedback">Отзывы</a></li>
        </ul>
      </div>
    </header>
  );
}





export default App;
